class Solution:
    """
    @param logs: the logs
    @return: the log after sorting
    """
    def logSort(self, logs):
        # Write your code here
        letter = []
        nums = []
        for log in logs:
            temp = log.split(' ')
            if temp[1].isdigit():
                nums.append(log)
            else:
                temp = (temp[1:], temp[0])
                letter.append((temp,log))
        if len(letter) != 0:
            letter.sort()
            new_letter = []
            for l in letter:
                new_letter.append(l[1])
        return new_letter+nums

